import LocalizedStrings from 'react-localization';

const Translations = new LocalizedStrings({
    en:{
      home:"Home",
      about:"About",
      polls:"Polls",
      news:"News",
      signin: "Sign-in"
    },
    ru: {
        home:"Домой",
        about:"О нас",
        polls:"Голосования",
        news:"Новости",
        signin: "Войти"
    }
   });

   export default Translations;
